(function($) {
	$.fn.inlinePhotosets = function() {
        return this.each(function(){
            var postCount = $(this).find('.photo-slideshow .single-photoset').length,
                leftControl = $(this).find('.ps-nav-left'),
                rightControl = $(this).find('.ps-nav-right'),
                postCurrent = 1;

            $(this).find('.single-photoset').each(function(i){
                $(this).addClass('slide-' + i);
            });

            $(this).find('.single-photoset:first-child').addClass('active');

            rightControl.on('click', function(){
                var $thisParent = $(this).parent();
                if ( postCount !== postCurrent ) {
                    $thisParent.find(".single-photoset").removeClass('active');
                    $thisParent.find(".slide-" + postCurrent).addClass('active');
                    postCurrent++;
                    $thisParent.find(".photoset-count span").text(postCurrent);
                }
            }); 

            leftControl.on('click', function(){
                var $thisParent = $(this).parent();
                if ( postCurrent !== 1 ) {
                    --postCurrent;
                    $thisParent.find(".single-photoset").removeClass('active');
                    $thisParent.find(".slide-" + (postCurrent - 1)).addClass('active');
                    // $thisParent.find(".single-photoset.active").removeClass('active').prev().addClass('active');
                    $thisParent.find(".photoset-count span").text(postCurrent);
                }
            }); 
        });
	}; // End
})(jQuery);









